import React from "react";
import "./Categary.css"
import catImg1 from "../Assets/cat1.png";
import catImg2 from "../Assets/cat2.png";
import catImg3 from "../Assets/cat3.png";

const Categary = () => {
  return (
    <>
      <div className="container-fluid mb-5">
        <div className="row categary">
            <h1>  </h1>
          <div className="col-md-4">
            <img src={catImg1} alt="" className="img-fluid" />
            <h2> Dress Watches </h2>
          </div>
          <div className="col-md-4">
            <img src={catImg2} alt="" className="img-fluid" />
            <h2> Men's Watches </h2>
          </div>
          <div className="col-md-4">
            <img src={catImg3} alt="" className="img-fluid" />
            <h2> Women's Watches </h2>
          </div>
        </div>
      </div>
    </>
  );
};

export default Categary;
